import React, { useEffect, useRef } from 'react';
import './css/parksPage.css';
import { GOOGLE_MAPS_API_KEY } from './mapsAPI';

function ParksPage({ onBackClick }) {
  return (
    <div className="parks-page-container">
      <h2>Parks Guide</h2>
      {/* Embed Google Map with predefined search for parks */}
      <iframe
        title="Google Map"
        className="map-container"
        width="600"
        height="450"
        loading="lazy"
        allowFullScreen
        src={`https://www.google.com/maps/embed/v1/search?key=${GOOGLE_MAPS_API_KEY}&q=parks`}
      ></iframe>
      <button className="back-button" onClick={onBackClick}></button>
    </div>
  );
}

export default ParksPage;
